import React, { Component } from 'react'
import './getList.css';

import Axios from 'axios';
import Swal  from 'sweetalert2';


export default class getList extends Component {

    constructor(props) {
        super(props);
            this.state = {
                getAllOrganization : []
            };
    }


    componentDidMount(){
        this.getList();
    }



    getList(){
        Axios.get('http://122.170.12.63:90/api/Organization/getAllOrganization')
        .then((response) => {
            console.log("response => ",response);
            this.setState({
                getAllOrganization : response.data.data
            },()=>{
                console.log(this.state.getAllOrganization)
            })
        })
        .catch(error =>{
            // Swal.fire("Sorry!","Please Enter Valid UserId or Password","warning");
        })
    }




    render() {
        return (
            <div className="blogListWrapper">
                <div className="col-lg-12 ">   
                    <div className="col-lg-8 col-lg-offset-2 GetlistWrapper">
                        <div className="col-lg-12 noPadding Heading">
                            <div className="col-lg-6 ">
                                <h3 className="boldFont  ">Organization List</h3>
                            </div>
                            <div className="col-lg-6 ">
                                <a href="/organization-Form"><div className="btn btn-primary boldFont btnheight pull-right">Add Organization</div></a>
                            </div> 
                        </div>
                        <hr/>  
                        <table class="table">
                            <thead>
                                <tr className="">
                                    <th>Sr#</th>
                                    <th>Organization Name</th>
                                    <th>Organization Sort Name</th>
                                    <th>Organization logo</th>
                                </tr>
                            </thead>
                            <tbody>
                            {
                                this.state.getAllOrganization && this.state.getAllOrganization.length > 0 
                                ?
                                    this.state.getAllOrganization.map((data,index)=>{
                                        return(
                                            <tr key={index}>
                                                <td>{index+1}</td>
                                                <td>{data.organizationName}</td>
                                                <td>{data.organizationShortName}</td>
                                                <td>{data.organizationUR}</td>
                                                <td>{data.organizationLOGO}</td>
                                            </tr>
                                        )
                                    })
                                : ""
                            }     
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>

        )
    }
}
